import React,{Fragment} from 'react'
import NavbarAddToCart from "../CustomerRestaurant/NavbarAddToCart.jsx"


function PastOrders(){
    return (
        <Fragment style={{textAlign:"center", fontFamily:"Postmates", height:"40px",lineHeight:"10px",margin:"100px"}}>
             <NavbarAddToCart />
             <h3>Past Orders</h3>
             <hr />

        </Fragment>
    )
}

export default PastOrders;
